import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
render() {
  return (
    <div className="App">
     <div className="calc-wrapper">
       <div className="row">
         <Button>7</Button>
         <Button>7</Button>
         <Button>7</Button>
         <Button>7</Button>
       </div>
     </div>
    </div>
  );
}
}

export default App;
